$(function(){$(".select_inverse, .select").selectpicker();$(".dbody > .row > div:first-child").on("click",function(a){var b=$(this);if($(a.target).closest(".popover").length){return}if(b.hasClass("active")){b.removeClass("active")}else{$(".dbody > .row > div").removeClass("active");b.addClass("active")}});$(window).scroll(function(){if($(this).scrollTop()>100){$(".go_up").fadeIn()}else{$(".go_up").fadeOut()}});$(".go_up").on("click",function(){$("body,html").animate({scrollTop:0},800);return false})});